package pattenPrograms;

public class Patten9 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n=5;
		 char x='a';
		for(int i=0;i<n;i++)
		{
			for(int j=0;j<n;j++)
			{
			System.out.print(x+" ");
            x++;	
			}
			
			System.out.println();
			 x='a';
			
		}


	}

}
